    width: '140px',
    textAlign: 'center',
    height: '40px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: '20px',
    color: 'white',
    marginTop: '20px'
}

const styleList2 ={
  textAlign: 'right'
}
